define({"topics" : [{"title":"Parallel Reads of a Topic","shortdesc":"\n                  <p class=\"shortdesc\">The Pulsar Consumer origin can subscribe to a single topic or to multiple topics. In         either case, the origin uses\n                     one thread to read from the topic or topics. To perform         parallel reads from the same topic, you can configure multiple\n                     pipelines with a Pulsar         Consumer origin that subscribe to the same topic.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#concept_yjj_bw4_z2b","attributes": {"data-id":"concept_yjj_bw4_z2b",},"menu": {"hasChildren":false,},"tocID":"concept_yjj_bw4_z2b-d46e92438","topics":[]}]});